import {Header,Footer, Blog, Possibility, Features, GPT3} from './containers';
import {Brand, Navbar, CTA,} from './components';
import './App.css'
function App() {
  return (
    <div className="App">
      <div className="gradient_bg">
        <Navbar/>
        <Header/>
      </div>
        <Brand/>
        <GPT3/>
        <Features/>
        <Possibility/>
        <CTA/>
        <Blog/>
        <Footer/>
    </div>
  );
}

export default App;
